import React from "react"

import StudentsData from "./StudentsData"
import { useTranslation, initReactI18next} from "react-i18next"
import { MdFormatListBulleted } from 'react-icons/md';

i18n
  .use(initReactI18next)
  .init({
    resources: {
      en: {
        translation: {
          "Welcome to React": "Welcome to React and react-i18next"
        }
      }
    },
    lng: "en", // if you're using a language detector, do not define the lng opti
    fallbackLng: "en",

    interpolation: {
      escapeValue: false // react already safes from xss => https://www.i18next.com/translation-function/interpolation#unescape
    }
  });

export default function DataTable(){

  const Students = (
    StudentsData.map(studenInfo => {
      return (
        <tr className="row-body text-3xl flex justify-between items-center">
          <td classNam=""
          >
            <MdFormatListBulleted className="text-5xl font-mediu"/>
            {studenInfo.Code}
          </td>
          <td
            className="hidden sm:flex"
          >
            {studenInfo.StudentName}
          </td>
          <td
            className="hidden lg:flex"
          >
            {studenInfo.StudentId}
          </td>
          <td
            className="hidden xl:flex"
          >
            {studenInfo.Attendance}
          </td>
          <td
            className="hidden 2xl:flex"
          >
            {studenInfo.Participation}
          </td>
        </tr>
      )
    })
  )

  return (
    <table className="flex flex-col justify-center items-center my-9">
      <thead className="bg-black text-white ">
        <tr className="row-header text-3xl flex justify-between items-center">
          <th className="">Code</th>
          <th className="hidden sm:flex">Student Name</th>
          <th className="hidden lg:flex">Student Id</th>
          <th className="hidden xl:flex">Attendance</th>
          <th className="hidden 2xl:flex">Participation</th>
        </tr>
      </thead>

      <tbody>
        {Students}
      </tbody>
    </table>
  )

}
